"use client";

/**
 * JourneyDailyLeversCard - 每日杠杆卡片
 *
 * 展示今日行动列表，支持签到和完成操作
 * 基于: Journey Page 4-state 系统
 */

import { motion } from "framer-motion";
import { useState } from "react";
import type { DailyLevers } from "@/types/journey";

interface JourneyDailyLeversCardProps {
  dailyLevers: DailyLevers;
  todayCheckedIn?: boolean;
  currentStreak?: number;
  onToggleLever?: (leverId: string) => void;
  onCheckin?: () => Promise<void>;
  onAdjustLevers?: () => void;
  className?: string;
}

function formatDate(dateStr: string): string {
  try {
    const date = new Date(dateStr);
    const today = new Date();
    const isToday = date.toDateString() === today.toDateString();

    if (isToday) {
      return "今天";
    }

    const month = date.getMonth() + 1;
    const day = date.getDate();
    return `${month}月${day}日`;
  } catch {
    return dateStr;
  }
}

export function JourneyDailyLeversCard({
  dailyLevers,
  todayCheckedIn = false,
  currentStreak = 0,
  onToggleLever,
  onCheckin,
  onAdjustLevers,
  className,
}: JourneyDailyLeversCardProps) {
  const [isCheckinLoading, setIsCheckinLoading] = useState(false);

  const { date, levers, energy_level, intention, stats } = dailyLevers;
  const completedCount = stats?.completed ?? levers.filter((l) => l.status === "completed").length;
  const totalCount = stats?.total ?? levers.length;
  const completionRate = stats?.completion_rate ?? (totalCount > 0 ? Math.round((completedCount / totalCount) * 100) : 0);

  const handleCheckin = async () => {
    if (!onCheckin || isCheckinLoading || todayCheckedIn) return;

    setIsCheckinLoading(true);
    try {
      await onCheckin();
    } finally {
      setIsCheckinLoading(false);
    }
  };

  return (
    <motion.div
      initial={{ opacity: 0, y: 10 }}
      animate={{ opacity: 1, y: 0 }}
      className={`bg-card border border-border rounded-2xl p-4 ${className}`}
    >
      {/* Header */}
      <div className="flex items-center justify-between mb-3">
        <div className="flex items-center gap-2">
          <span className="text-xl">⚡</span>
          <h3 className="font-semibold text-foreground">今日杠杆</h3>
          <span className="text-xs text-muted-foreground">{formatDate(date)}</span>
        </div>
        <div className="flex items-center gap-2">
          <span className="text-sm text-muted-foreground">
            {completedCount}/{totalCount}
          </span>
        </div>
      </div>

      {/* Checkin Section */}
      <div className="mb-4 p-3 bg-muted/50 rounded-lg">
        <div className="flex items-center justify-between">
          <div className="flex items-center gap-3">
            {/* Streak */}
            <div className="flex items-center gap-1">
              <span className="text-lg">🔥</span>
              <span className="text-sm font-medium text-foreground">{currentStreak}</span>
              <span className="text-xs text-muted-foreground">天</span>
            </div>

            {/* Energy Level */}
            {energy_level && (
              <div className="flex items-center gap-1">
                <span className="text-sm">⚡</span>
                <span className="text-xs text-muted-foreground">能量 {energy_level}/10</span>
              </div>
            )}
          </div>

          {/* Checkin Button */}
          <button
            onClick={handleCheckin}
            disabled={todayCheckedIn || isCheckinLoading}
            className={`px-4 py-1.5 text-sm rounded-lg transition-all ${
              todayCheckedIn
                ? "bg-emerald-500/20 text-emerald-600 dark:text-emerald-400 cursor-default"
                : isCheckinLoading
                ? "bg-muted text-muted-foreground cursor-wait"
                : "bg-primary text-primary-foreground hover:opacity-90"
            }`}
          >
            {todayCheckedIn ? "✓ 已签到" : isCheckinLoading ? "签到中..." : "签到"}
          </button>
        </div>

        {/* Intention */}
        {intention && (
          <p className="text-xs text-muted-foreground mt-2 italic">
            "{intention}"
          </p>
        )}
      </div>

      {/* Levers List */}
      {totalCount > 0 ? (
        <div className="space-y-2">
          {levers.map((lever, index) => (
            <motion.div
              key={lever.id}
              initial={{ opacity: 0, x: -10 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: index * 0.05 }}
              className={`flex items-center gap-3 p-2 rounded-lg transition-colors ${
                lever.status === "completed"
                  ? "bg-emerald-500/10"
                  : lever.status === "skipped"
                  ? "bg-muted/30"
                  : "bg-muted/50 hover:bg-muted"
              }`}
            >
              {/* Checkbox */}
              <button
                onClick={() => onToggleLever?.(lever.id)}
                disabled={!onToggleLever || lever.status === "skipped"}
                className={`flex-shrink-0 w-5 h-5 rounded border-2 flex items-center justify-center transition-colors ${
                  lever.status === "completed"
                    ? "bg-emerald-500 border-emerald-500 text-white"
                    : lever.status === "skipped"
                    ? "bg-muted border-muted-foreground/20"
                    : "border-muted-foreground/30 hover:border-primary"
                } ${!onToggleLever || lever.status === "skipped" ? "cursor-default" : "cursor-pointer"}`}
              >
                {lever.status === "completed" && (
                  <svg
                    className="w-3 h-3"
                    fill="none"
                    viewBox="0 0 24 24"
                    stroke="currentColor"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth={3}
                      d="M5 13l4 4L19 7"
                    />
                  </svg>
                )}
                {lever.status === "skipped" && (
                  <span className="text-[10px] text-muted-foreground">—</span>
                )}
              </button>

              {/* Task Text */}
              <span
                className={`text-sm flex-1 ${
                  lever.status === "completed"
                    ? "text-muted-foreground line-through"
                    : lever.status === "skipped"
                    ? "text-muted-foreground/50 line-through"
                    : "text-foreground"
                }`}
              >
                {lever.task}
              </span>

              {/* Skip reason */}
              {lever.status === "skipped" && lever.skip_reason && (
                <span className="text-[10px] text-muted-foreground">
                  {lever.skip_reason}
                </span>
              )}
            </motion.div>
          ))}
        </div>
      ) : (
        <div className="text-center py-4">
          <p className="text-sm text-muted-foreground">今日暂无杠杆行动</p>
        </div>
      )}

      {/* Progress Bar */}
      {totalCount > 0 && (
        <div className="mt-4">
          <div className="h-1.5 bg-muted rounded-full overflow-hidden">
            <motion.div
              initial={{ width: 0 }}
              animate={{ width: `${completionRate}%` }}
              transition={{ duration: 0.5, ease: "easeOut" }}
              className="h-full bg-emerald-500 rounded-full"
            />
          </div>
          <p className="text-xs text-muted-foreground mt-1 text-right">
            {completionRate}% 完成
          </p>
        </div>
      )}

      {/* Adjust Button */}
      {onAdjustLevers && (
        <button
          onClick={onAdjustLevers}
          className="w-full mt-3 py-2 text-sm text-muted-foreground hover:text-foreground hover:bg-muted rounded-lg transition-colors"
        >
          调整今日杠杆
        </button>
      )}
    </motion.div>
  );
}

export default JourneyDailyLeversCard;

"use client";

/**
 * NorthStarCard - 北极星愿景卡片
 *
 * 展示愿景场景、反愿景场景、身份转换
 * 支持 compact 模式用于执行状态
 * 基于: docs/components/ui/journey.md State 3
 */

import { motion } from "framer-motion";
import { useState } from "react";
import type { NorthStar, Identity } from "@/types/journey";

interface NorthStarCardProps {
  northStar: NorthStar;
  identity?: Identity;
  /** 紧凑模式 - 用于 planned/executing 状态 */
  compact?: boolean;
  onEdit?: () => void;
  onTalkToFutureSelf?: () => void;
  className?: string;
}

export function NorthStarCard({
  northStar,
  identity,
  compact = false,
  onEdit,
  onTalkToFutureSelf,
  className,
}: NorthStarCardProps) {
  const [showAntiVision, setShowAntiVision] = useState(false);
  const [expanded, setExpanded] = useState(false);

  const hasVision = !!northStar.vision_scene;
  const hasAntiVision = !!northStar.anti_vision_scene;
  const hasIdentity = !!identity?.target;

  if (!hasVision && !hasAntiVision) return null;

  // Compact mode - collapsed view
  if (compact && !expanded) {
    return (
      <motion.div
        initial={{ opacity: 0, y: 10 }}
        animate={{ opacity: 1, y: 0 }}
        className={`bg-card border border-border rounded-2xl p-3 ${className}`}
      >
        <div className="flex items-center justify-between">
          <div className="flex items-center gap-2 flex-1 min-w-0">
            <span className="text-lg">⭐</span>
            <p className="text-sm text-foreground truncate flex-1">
              {northStar.vision_scene}
            </p>
          </div>
          <div className="flex items-center gap-2 flex-shrink-0">
            <button
              onClick={() => setExpanded(true)}
              className="text-xs text-muted-foreground hover:text-foreground transition-colors"
            >
              展开
            </button>
            {onEdit && (
              <button
                onClick={onEdit}
                className="text-xs text-muted-foreground hover:text-foreground transition-colors"
              >
                编辑
              </button>
            )}
          </div>
        </div>

        {/* Identity badge in compact mode */}
        {hasIdentity && (
          <div className="mt-2 flex items-center gap-1">
            <span className="text-xs">🪪</span>
            <span className="text-xs text-emerald-600 dark:text-emerald-400 truncate">
              {identity.target}
            </span>
          </div>
        )}
      </motion.div>
    );
  }

  // Full mode (or expanded compact mode)
  return (
    <motion.div
      initial={{ opacity: 0, y: 10 }}
      animate={{ opacity: 1, y: 0 }}
      className={`bg-card border border-border rounded-2xl p-4 ${className}`}
    >
      {/* Header */}
      <div className="flex items-center justify-between mb-3">
        <div className="flex items-center gap-2">
          <span className="text-xl">⭐</span>
          <h3 className="font-semibold text-foreground">北极星</h3>
        </div>
        <div className="flex items-center gap-2">
          {compact && (
            <button
              onClick={() => setExpanded(false)}
              className="text-xs text-muted-foreground hover:text-foreground transition-colors"
            >
              收起
            </button>
          )}
          {onEdit && (
            <button
              onClick={onEdit}
              className="text-xs text-muted-foreground hover:text-foreground transition-colors"
            >
              编辑
            </button>
          )}
        </div>
      </div>

      {/* Vision Scene */}
      {hasVision && (
        <div className="mb-4">
          <p className="text-sm text-foreground leading-relaxed">
            "{northStar.vision_scene}"
          </p>
          {northStar.vision_timeframe && (
            <p className="text-xs text-muted-foreground mt-1">
              {northStar.vision_timeframe}
            </p>
          )}
        </div>
      )}

      {/* Identity */}
      {hasIdentity && (
        <div className="mb-4 p-3 bg-emerald-500/10 border border-emerald-500/20 rounded-lg">
          <div className="flex items-center gap-1 text-xs text-emerald-600 dark:text-emerald-400 mb-1">
            <span>🪪</span>
            <span>新身份</span>
          </div>
          <p className="text-sm text-foreground">{identity.target}</p>
          {identity.current && (
            <p className="text-xs text-muted-foreground mt-1 line-through">
              旧：{identity.current}
            </p>
          )}
        </div>
      )}

      {/* Anti-Vision Toggle */}
      {hasAntiVision && (
        <div className="mb-4">
          <button
            onClick={() => setShowAntiVision(!showAntiVision)}
            className="flex items-center gap-2 text-xs text-muted-foreground hover:text-foreground transition-colors"
          >
            <span>🔥</span>
            <span>反愿景</span>
            <span className="text-[10px]">{showAntiVision ? "▲" : "▼"}</span>
          </button>

          {showAntiVision && (
            <motion.div
              initial={{ opacity: 0, height: 0 }}
              animate={{ opacity: 1, height: "auto" }}
              exit={{ opacity: 0, height: 0 }}
              className="mt-2 p-3 bg-red-500/10 border border-red-500/20 rounded-lg"
            >
              <p className="text-sm text-foreground">
                "{northStar.anti_vision_scene}"
              </p>
            </motion.div>
          )}
        </div>
      )}

      {/* Pain Points */}
      {northStar.pain_points && northStar.pain_points.length > 0 && (
        <div className="mb-4">
          <p className="text-xs text-muted-foreground mb-2">持续的不满：</p>
          <div className="flex flex-wrap gap-2">
            {northStar.pain_points.map((point, index) => (
              <span
                key={index}
                className="text-xs px-2 py-1 bg-muted rounded-full text-muted-foreground"
              >
                {point}
              </span>
            ))}
          </div>
        </div>
      )}

      {/* CTA */}
      {onTalkToFutureSelf && (
        <button
          onClick={onTalkToFutureSelf}
          className="w-full py-2 text-sm text-primary hover:bg-primary/5 rounded-lg transition-colors"
        >
          和未来的我对话 →
        </button>
      )}
    </motion.div>
  );
}

export default NorthStarCard;

