"use client";

/**
 * PlannedStateCard - 已规划状态的 CTA 卡片
 *
 * State 2: 有路线图，无周大石头时显示
 * 引导用户设定本周大石头
 */

import { motion } from "framer-motion";

interface PlannedStateCardProps {
  onSetWeeklyRocks?: () => void;
