const withBundleAnalyzer = require('@next/bundle-analyzer')({
  enabled: process.env.ANALYZE === 'true',
})

/** @type {import('next').NextConfig} */
const nextConfig = {
  reactStrictMode: true,
  transpilePackages: ["@vibelife/ui"],
  images: {
    // 图片域名白名单 (通过 NEXT_PUBLIC_IMAGE_DOMAINS 环境变量配置，逗号分隔)
    domains: (process.env.NEXT_PUBLIC_IMAGE_DOMAINS || "localhost").split(",").map(d => d.trim()),
  },
  // experimental: {
  //   optimizePackageImports: [
  //     'lucide-react',
  //     'framer-motion',
  //     '@radix-ui/react-icons',
  //     '@radix-ui/react-dialog',
  //     '@radix-ui/react-dropdown-menu',
  //     '@radix-ui/react-tooltip',
  //     'date-fns',
  //     'echarts',
  //     'zod',
  //     'react-hook-form',
  //   ],
  // },
  compiler: {
    removeConsole: process.env.NODE_ENV === 'production',
  },
  async rewrites() {
    // 服务端代理：/api/v1/* -> 后端 API
    // 使用 VIBELIFE_API_INTERNAL 作为服务端后端地址
    const apiInternal = process.env.VIBELIFE_API_INTERNAL || "http://127.0.0.1:8000";
    return [
      {
        source: "/api/v1/:path*",
        destination: `${apiInternal}/api/v1/:path*`,
      },
      {
        source: "/health",
        destination: `${apiInternal}/health`,
      },
    ];
  },
};

module.exports = withBundleAnalyzer(nextConfig);

